import React from 'react'


function Nav() {
    return (
        <div className="nav" >
            <img
                className="nav__logo"
                src="https://drive.google.com/file/d/1FWIB8bOKy0YJ8ie2OcJJwWnqinRcU_IC/view?usp=sharing"
                alt="Netflix Logo"
            />

            <img
                className="nav__avatar"
                src="https://drive.google.com/file/d/1pRBIxPK9_P6ZiQU09R4_fphVC00WOnGV/view?usp=sharing"
                alt="Netflix Logo"
            />

        </div>
    );
}

export default Nav;
